import React from 'react'
import {GetUsers} from './Request'
import { useEffect } from 'react';

export default function CallOnInterval() {
    useEffect(() => {
        const interval = setInterval(() => {
          GetUsers();
        }, 10000);
        return () => clearInterval(interval);
      }, []);
}
